INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (3894, N'Biotin/Folic Acid Combo', NULL, NULL, NULL, 142, N'b8ca3a65-0166-11e4-fbb5-a19b69d1b510', NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/biofolicenergy/', NULL, N'7', NULL, NULL, N'Biotin is part of the B complex group of vitamins, which supports healthy skin, nail and hair growth. Folic acid is another B vitamin also beneficial to hair health. Biotin and folic acid support energy production in your cells by converting fat into a usable form of energy. These vitamins are essential to fight fatigue throughout the day!')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (3895, N'Panax Ginseng', NULL, NULL, NULL, 142, N'b8ca3a65-0166-11e4-fbb5-a19b97b08314', NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/ginseng/', NULL, N'7', NULL, NULL, N'White Panax Ginseng is a plant and the roots have been used to make medicine and is linked to alertness, energy and physical stamina. Key features: stimulates physical and mental activity; wards off fatigue; supports sustained energy')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (3896, N'ModCarb', NULL, NULL, NULL, 142, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/modcarb/', NULL, N'7', NULL, NULL, N'Created with six organic, healthy grains oats, amaranth, buckwheat, chia, millet and quinoa, ModCarb is a real advantage for athletes in training, dieters who want to avoid sudden cravings or anyone who experiences energy dips during their typical daily routine. It delivers nutrition rich complex carbohydrate for energy production and utilization by the body. Key features: sustained energy formula; natural energy.')
