INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (3899, N'CoQ10', NULL, NULL, NULL, 142, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/coq10/', NULL, N'7', NULL, NULL, N'Coenzyme Q10 is a substance similar to a vitamin, which helps to increase energy and speed recovery from exercise. Key features: combat depleting energy; experience less fatigue after exercising; speeds recovery from exercise.')
