INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11576, N'FibreGum', N'21', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smfiber/', NULL, N'7', NULL, N'', N'Fibersol-2 is a dietary fiber that promotes intestinal regularity and helps lower LDL cholesterol levels.Key features: lowers LDL cholesterol; reduces blood glucose levels; effective as a prebiotic in the GI tract.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11577, N'Chia', N'22', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smantioxidant/', NULL, N'7', NULL, NULL, N'Setria Glutathione is a tripeptide composed of glutamic acid, cysteine and glycine and is present in nearly every cell of the body.  Glutathione is considered the most important antioxidant, since it is the only one capable of working with enzymes.Key features:  increases antioxidant capacity; protects cells against oxidative stress; helps to fortify our immune system')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11578, N'L-Glutamine', N'23', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smvitaminc/', NULL, N'7', NULL, NULL, N'Vitamin C also known as ascorbic acid is essential for normal growth and development.  Vitamin C is used in the growth and repair of tissues of the human body. ')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11579, N'Astrigin', N'24', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smimmunity/', NULL, N'7', NULL, NULL, N'Wellmune and ResistAid are immune supporting ingredients. Wellmune is derived from a proprietary strain of yeast and helps to enhance the immune system to help keep your body healthy. It helps to mobilize billions of innate immune cells that are part of the bodys natural defenses. ResistAid is derived solely from larch trees. ResistAid helps natural immune function by increasing beneficial immune cell populations.')
