INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11581, N'ActivAloe', N'26', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smvitamind/', NULL, N'7', NULL, NULL, N'Vitamin D plays an important role in sports nutrition, bone health and healthy looking skin.  Its active form, calcitriol, contributes to skin cell growth and repair, while creating an impermeable barrier against environmental conditions. Key features: improves skin cell repair and elasticity; strengthens bones; reduce the risk of osteoporosis; helps calcium absorption; decrease risk of injury; improve physical performance.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11582, N'Ganeden BC30', N'27', NULL, NULL, 160, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smbone/', NULL, N'7', NULL, NULL, N'Peptan-B, a Type 1 collagen peptide, has been shown to stimulate the bone cells responsible for bone formation (osteoblasts) triggering an increase in bone formation which helps to maintain bone health and structure. Key benefits:Peptan can promote bone health by:  reducing bone resorption (breakdown); restoring bone mineral density; increasing bone size and solidity.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11583, N'***', N'28', NULL, NULL, NULL, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smjoint/', NULL, N'7', NULL, NULL, N'Fortigel is an ingredient for the regeneration of joint cartilage. It activates the growth of new collagen. Fortigel is a natural collagen peptides which contributes to the maintenance of joint health and preserves mobility and quality of life. OptiMSM is a premium form of Methylsulfonylmethane(MSM) supports healthy joints and prevents cartilage breakdown. ')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11584, N'Fibersol-2', N'29', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smprobiotic/', NULL, N'7', NULL, NULL, N'GanedenBC30 is a natural probiotic that aids in digestion and to maintain a healthy immune system. Unlike other probiotics, BC30 survives the harsh conditions of the stomach. GanedenBC30 supports immune health and reduces gastrointestinal symptoms.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11585, N'CravingZgone', N'30', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smdigestive/', NULL, N'7', NULL, NULL, N'Fibregum is an all natural, GMO free source of soluble dietary fiber, obtained from carefully selected acacia gum sap exuded from the stems and branches of acacia trees.AstraGin provides for truly improved bioavailability by allowing a greater amount of these nutrients to pass from the bloodstream into the cells.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11586, N'Pantesin', N'31', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smcholesterol/', NULL, N'7', NULL, NULL, N'Pantesin Pantethine helps to maintain cholesterol levels within the normal range and helps to support a healthy cardiovascular system. Key features: reduces cholesterol levels; increases metabolic activity for Coenzyme A; helps to support cardiovascular health.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11587, N'ActiveAloe', N'32', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smbloodp/', NULL, N'7', NULL, NULL, N'MegaNatural-BP is a patented grape seed extract that has been shown to support healthy blood pressure levels. MegaNatural-BP improves blood flow by relaxing blood vessels, reduces blood pressure levels and contains polyphenols.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11588, N'Glutamine', N'33', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smbrainsup/', NULL, N'7', NULL, NULL, N'SerinAid is a naturally occurring PhosphatidylSerine. PS is highly recognized as a mental performance supplement.  SerinAid PS has shown to improve memory, concentration and focus. It may also reduce the risk of cognitive dysfunction and dementia in the elderly. Cognizin is a form of citicoline, which is essential for brain health. It maintains normal levels of acetylcholine which is a vital nutrient for memory and cognitive function')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11589, N'Lipowheat', N'34', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smskinbeaut/', NULL, N'7', NULL, NULL, N'Verisol is a bioactive collagen peptide, which promotes skin elasticity, hydration and the reduction of wrinkles. It helps to nourish the deepest layers of our skin, which is important at all ages. Pycnogenol is a mixture of bioflavonoids obtained from the bark of the French maritime pine tree. It increases skin elasticity and smoothness, by attaching to the skin proteins collagen and elastin,to produce collagen and hyaluronic acid.')
INSERT INTO [thinkitdrinkitData].[Boost] ([id], [Name], [Order], [FuncDBfunc_id], [FuncDBsport_id], [BaseDBbase_id], [VendID], [Access2], [AccessPurpose], [Image], [Info], [Label], [Price], [Info2], [Info3], [InfoLite]) VALUES (11590, N'Hemp Protein', N'35', NULL, NULL, 161, NULL, NULL, NULL, N'https://thinkitdrinkit.blob.core.windows.net/thinkitdrinkitappimagesboost/purpose2/optimsmcurrent.png', N'http://storeapp.thinkitdrinkit.com/smeye/', NULL, N'7', NULL, NULL, N'FloraGLO Lutein has been clinically proven to be absorbed by the body and increase macular pigment. Key features: protects our eyes from free radicals; increases macular pigment which can improve visual performance; reduces the risk and progression of Age-Related Macular Degeneration.')
